import * as React from "react";
import Card from "@mui/joy/Card";
import CardContent from "@mui/joy/CardContent";
import Typography from "@mui/joy/Typography";
import { techCardInfo,
  timeManagementCardInfo,
  resourcefulnessCardnfo,
  physEdCardInfo,
  lifeWorkBalanceCardInfo,
  leadershipCardInfo,
  homeEconomicsCardInfo,
  criticalThinkingCardInfo,
  creativityCardInfo,
  conflictManagementCardInfo,
  classroomManagementCardInfo,
  boundarySettingCardInfo,
  behaviourManagementCardInfo,
} from "../Data";



export default function BlankSkillCard() {

  const cardDataSets = [
  techCardInfo,
  timeManagementCardInfo,
  resourcefulnessCardnfo,
  physEdCardInfo,
  lifeWorkBalanceCardInfo,
  leadershipCardInfo,
  homeEconomicsCardInfo,
  criticalThinkingCardInfo,
  creativityCardInfo,
  conflictManagementCardInfo,
  classroomManagementCardInfo,
  boundarySettingCardInfo,
  behaviourManagementCardInfo,
  ];

  return (
    <>
    {cardDataSets.map((cardDataSet, index) => (
    <Card
      variant="outlined"
      sx={{
        minWidth: 300,
        width: "25%",
        borderRadius: "5px",
        "--Card-radius": (theme) => theme.vars.radius.xs,
      }}
    >
      <CardContent
        orientation="horizontal"
        sx={{ alignItems: "flex-start", gap: 1, position: "relative" }}
      ></CardContent>
      <CardContent>
        <Typography sx={{ textAlign: "start", fontWeight: 'bold', position: "absolute", top: 3 }} fontSize="16px">
            {cardDataSet[0].skill}
          </Typography>
          {cardDataSet.map((cardDataSet, index) => (
          <Typography sx= {{ textAlign: 'start', border: "1px solid #233349", borderRadius: "5px", padding: "6px" }}>
          {cardDataSet.details}
        </Typography>
        ))}
      </CardContent>
    </Card>
     ))}
    </>
  );
}
